import LolBack from "./images/leagueOfLegendsBack.jpg"
import ValorantBack from "./images/ValorantBack.jpg"
import RocketBack from "./images/RocketBack.jpg"
export default [
    {
        name:"League Of  Legends",
        backImage:URL("./images/leagueOfLegendsBack.jpg"),
        numberOfCoaches: 25,
    },
    {
        name:"Valorant",
        backImage:{ValorantBack},
        numberOfCoaches: 10,
    },
    {
        name:"Rocket League",
        backImage:{RocketBack},
        numberOfCoaches: 5,
    },
    
]
